// import Login from "./login";
import SignUp from "./signup";
import { BrowserRouter as Router , Route , Switch } from "react-router-dom";
import Login from "./login";

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route path="./" component={Login} exact />
          <Route path="./signup" component={SignUp} exact />
        </Switch>
      </Router>
    </>
  );
}

export default App;
